let way =
  "C:/New_folder/React/Projects/1_First_project/react_first/src/App.css";
const MyPosts = () => {
  return (
    <div>
      <div>
        <textarea></textarea>
        <button>Add post</button>
        <button>Remove</button>
      </div>
      <div className={class_myposts.my_posts}>
        <div className={class_myposts.new_post}>
